      <div className="App">
        <header className="App-header">
         <h1>Skimmer</h1>
          <form>
            <p>
            <input type="text" input="Input" placeholder="Input"/>
            </p>
            <p>
             <button onClick={this.handleClick}>
        Submit
      </button>
            </p>
          </form>
        </header>
      </div>
    );
  }
}

export default App;
